import React, { useState, useEffect } from "react";

export default function AdminPreferences() {
  const [rankedPreferences, setRankedPreferences] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/api/users")
      .then(res => res.json())
      .then(users => {
        const counts = {};
        users.forEach(u => {
          if (u.preferences && u.preferences.length > 0) {
            u.preferences.forEach(pref => {
              counts[pref] = (counts[pref] || 0) + 1;
            });
          }
        });

        const ranked = Object.keys(counts)
          .map(pref => ({ preference: pref, count: counts[pref] }))
          .sort((a, b) => b.count - a.count);

        setRankedPreferences(ranked);
      })
      .catch(err => console.error("Error fetching users:", err));
  }, []);

  return (
    <div style={{ marginLeft: 220, padding: 20 }}>
      <h2>Ranked Preferences Across All Users</h2>
      {rankedPreferences.length === 0 ? (
        <p>No preferences found.</p>
      ) : (
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th style={{ border: "1px solid #ccc", padding: 8 }}>Rank</th>
              <th style={{ border: "1px solid #ccc", padding: 8 }}>Preference</th>
              <th style={{ border: "1px solid #ccc", padding: 8 }}>Count</th>
            </tr>
          </thead>
          <tbody>
            {rankedPreferences.map((p, index) => (
              <tr key={p.preference}>
                <td style={{ border: "1px solid #ccc", padding: 8 }}>{index + 1}</td>
                <td style={{ border: "1px solid #ccc", padding: 8 }}>{p.preference}</td>
                <td style={{ border: "1px solid #ccc", padding: 8 }}>{p.count}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
